contracts/SCM_Project.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract SupplyChain {

    // Enum for different states in the supply chain
    enum State { Created, InTransit, Delivered }

    // Structure to represent a product
    struct Product {
        uint productId;
        string name;
        string origin;
        uint256 manufactureDate;
        address currentOwner;
        State state;
        address[] ownershipHistory;
    }

    // Mapping of product ID to Product
    mapping(uint => Product) public products;

    // Auto-incrementing ID for new products
    uint public nextProductId = 1;

    // Events for tracking lifecycle
    event ProductCreated(uint productId, string name, address indexed owner);
    event OwnershipTransferred(uint productId, address from, address to);
    event ProductDelivered(uint productId, address indexed to);

    // Modifier to check the caller is product owner
    modifier onlyOwner(uint _productId) {
        require(products[_productId].currentOwner == msg.sender, "Not product owner");
        _;
    }

    // Function to create a product by Manufacturer
    function createProduct(
        string memory _name,
        string memory _origin,
        uint256 _manufactureDate
    ) public {
        // Step 1: Create the Product struct with all fields except dynamic array
        Product storage newProduct = products[nextProductId];
        newProduct.productId = nextProductId;
        newProduct.name = _name;
        newProduct.origin = _origin;
        newProduct.manufactureDate = _manufactureDate;
        newProduct.currentOwner = msg.sender;
        newProduct.state = State.Created;

        // Step 2: Initialize ownershipHistory by pushing current owner
        newProduct.ownershipHistory.push(msg.sender);

        emit ProductCreated(nextProductId, _name, msg.sender);
        nextProductId++;
    }

    // Function to transfer ownership from one party to another
    function transferOwnership(uint _productId, address _to) public onlyOwner(_productId) {
        require(_to != address(0), "Invalid recipient");

        Product storage product = products[_productId];
        address previousOwner = product.currentOwner;
        product.currentOwner = _to;
        product.ownershipHistory.push(_to);
        product.state = State.InTransit;

        emit OwnershipTransferred(_productId, previousOwner, _to);
    }

    // Function to mark product as delivered to final customer
    function markAsDelivered(uint _productId) public onlyOwner(_productId) {
        Product storage product = products[_productId];
        product.state = State.Delivered;

        emit ProductDelivered(_productId, msg.sender);
    }

    // View function to get ownership history
    function getOwnershipHistory(uint _productId) public view returns (address[] memory) {
        return products[_productId].ownershipHistory;
    }

    // View function to get product details
    function getProduct(uint _productId) public view returns (
        uint, string memory, string memory, uint256, address, State
    ) {
        Product memory p = products[_productId];
        return (p.productId, p.name, p.origin, p.manufactureDate, p.currentOwner, p.state);
    }
}

